    'help.HowDoIChangeAPicture_content': '\u09AC\u09BF\u099C\u09CD\u099E\u09BE\u09AA\u09A8 \u09B8\u09AE\u09CD\u09AA\u09BE\u09A6\u09A8\u09BE \u0995\u09B0\u09BE\u09B0 \u09AA\u09A6\u09CD\u09A7\u09A4\u09BF\u0997\u09C1\u09B2\u09BF \u0985\u09A8\u09C1\u09B8\u09B0\u09A3 \u0995\u09B0\u09C7 \u0986\u09AA\u09A8\u09BF \u099B\u09AC\u09BF \u09AA\u09B0\u09BF\u09AC\u09B0\u09CD\u09A4\u09A8 \u0995\u09B0\u09A4\u09C7 \u09AA\u09BE\u09B0\u09C7\u09A8\u0964 \u0986\u09AA\u09A8\u09BF \u09B8\u09AE\u09CD\u09AA\u09BE\u09A6\u09A8\u09BE\u09B0 \u09AA\u09BE\u09A4\u09BE\u09DF \u09A5\u09BE\u0995\u09B2\u09C7 \u099B\u09AC\u09BF\u09B0 \u09AC\u09BF\u09AD\u09BE\u0997\u09C7 \u0997\u09BF\u09DF\u09C7 \u099B\u09AC\u09BF \u09AE\u09C1\u099B\u09A4\u09C7 \u09B9\u09B2\u09C7 \u201C\u098F\u0987 \u099B\u09AC\u09BF\u099F\u09BF \u0985\u09AA\u09B8\u09BE\u09B0\u09A3 \u0995\u09B0\u09C1\u09A8\u201D-\u098F \u0995\u09CD\u09B2\u09BF\u0995 \u0995\u09B0\u09C1\u09A8 \u098F\u09AC\u0982 \u09A8\u09A4\u09C1\u09A8 \u099B\u09AC\u09BF \u0986\u09AA\u09B2\u09CB\u09A1 \u0995\u09B0\u09BE\u09B0 \u099C\u09A8\u09CD\u09AF \u201C\u0986\u09B0\u09C7\u0995\u099F\u09BF \u099B\u09AC\u09BF \u09AF\u09C1\u0995\u09CD\u09A4 \u0995\u09B0\u09C1\u09A8\u201D-\u098F \u0995\u09CD\u09B2\u09BF\u0995 \u0995\u09B0\u09C1\u09A8\u0964|',
