    'help.HowDoISaveAPostingToRecallItLater_content': '\u0986\u09AA\u09A8\u09BF \u09AF\u09C7\u09B8\u09AC \u09A4\u09BE\u09B2\u09BF\u0995\u09BE\u09B0 \u09AC\u09CD\u09AF\u09BE\u09AA\u09BE\u09B0\u09C7 \u0986\u0997\u09CD\u09B0\u09B9\u09C0 \u09B8\u09C7\u0997\u09C1\u09B2\u09BF\u09A4\u09C7 \u09AF\u09BE\u09A8 \u098F\u09AC\u0982 \u098F\u09B0 \u0997\u09A4\u09BF\u09AC\u09BF\u09A7\u09BF \u09A6\u09C7\u0996\u09BE\u09B0 \u099C\u09A8\u09CD\u09AF "\u09AA\u099B\u09A8\u09CD\u09A6\u09C7\u09B0 \u09A4\u09BE\u09B2\u09BF\u0995\u09BE\u09DF \u09AF\u09C1\u0995\u09CD\u09A4 \u0995\u09B0\u09C1\u09A8" \u09AC\u09CB\u09A4\u09BE\u09AE\u099F\u09BF \u0995\u09CD\u09B2\u09BF\u0995 \u0995\u09B0\u09C1\u09A8 |',
